import { Component } from '@angular/core';
import { IonicPage, NavController, NavParams } from 'ionic-angular';


import { ApiserviceProvider } from '../../providers/apiservice/apiservice';
import { LoadingController } from 'ionic-angular';


/**
 * Generated class for the VerreportePage page.
 *
 * See https://ionicframework.com/docs/components/#navigation for more info on
 * Ionic pages and navigation.
 */

@IonicPage()
@Component({
  selector: 'page-verreporte',
  templateUrl: 'verreporte.html',
})
export class VerreportePage {

  constructor(  public navCtrl: NavController,
                public navParams: NavParams,
                public apiservice: ApiserviceProvider,    // Construir el servicio api
                public loadingCtrl: LoadingController,
          ) {
  }


  public verUsu = this.navParams.get('usuario');
  public verDirec = this.navParams.get('direccion');
  public verFecha = this.navParams.get('created_at');
  public verFoto = this.navParams.get('foto');
  public verReporte = this.navParams.get('reporte');


  // Photo Base64 Store
  public base64Image: string;


  downLoadImage() {

    console.log('DownLoad Imagen...' );

    const loader = this.loadingCtrl.create({
      content: "Obteniendo reporte...",
      duration: 2000,
    });
    loader.present();

    this.apiservice.downLoadFile( this.verFoto ).subscribe(
      data => {
        console.log( 'File length: ' + data.length + ' bytes.' );
        this.base64Image = data;
      },
      error => {
        console.log( 'Download error: ' + error.message );
        this.base64Image = "data:image/jpeg;base64," + '';
      }
    );

    loader.dismissAll();

  }  

  ionViewDidLoad() {
    // console.log('ionViewDidLoad VerreportePage');
    this.downLoadImage();
  }


}
